import React, { useEffect, useState } from 'react';

const AdminReports = () => {
  const [reports, setReports] = useState([]);

  // Exemple d'appel d'API pour rÃ©cupÃ©rer les rapports
  useEffect(() => {
    // Remplace cette URL par ton endpoint rÃ©el si tu en as un
    fetch('http://localhost:4000/api/reports')
      .then((res) => res.json())
      .then((data) => setReports(data))
      .catch((err) => {
        console.error('Erreur lors du chargement des rapports :', err);
        // Tu peux mettre des donnÃ©es mock si besoin pour tester l'affichage
        setReports([
          { id: 1, user: 'Ahmed', message: 'ProblÃ¨me de rÃ©servation', date: '2025-07-18' },
          { id: 2, user: 'Sarra', message: 'Erreur lors du paiement', date: '2025-07-17' },
        ]);
      });
  }, []);

  return (
    <div>
      <h1 style={{ marginBottom: 20 }}>ðŸ“„ Rapports des utilisateurs</h1>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr style={{ backgroundColor: '#f0f0f0' }}>
            <th style={thStyle}>ID</th>
            <th style={thStyle}>Utilisateur</th>
            <th style={thStyle}>Message</th>
            <th style={thStyle}>Date</th>
          </tr>
        </thead>
        <tbody>
          {reports.map((report) => (
            <tr key={report.id}>
              <td style={tdStyle}>{report.id}</td>
              <td style={tdStyle}>{report.user}</td>
              <td style={tdStyle}>{report.message}</td>
              <td style={tdStyle}>{report.date}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

const thStyle = {
  padding: '12px',
  textAlign: 'left',
  borderBottom: '1px solid #ccc',
};

const tdStyle = {
  padding: '10px',
  borderBottom: '1px solid #eee',
};

export default AdminReports;
